import React from 'react'
import styled from 'styled-components'
import image from './Logos/3.png'
import image1 from './Logos/4.png'

const SliderBar = styled.header`

.img1{
    height:981px;
    background-image:url(${image});
    background-repeat:no-repeat;
    background-size:100%;
    background-size:cover;
    background-position:center;
    opacity:0.4;
}
.main{
    background-color:#F56753
}
`
function Slider() {
    return (
        <>
            <SliderBar>
                <div className="fluid-container">
                    <div className="main">
                        <div className="img1 ">
                            <h1 className='fs-1 text-white text-opacity-100'>checkout our vanlife experience in india</h1>
                        </div>

                    </div>

                </div>
            </SliderBar>

        </>
    )
}

export default Slider
